import React from 'react';
import ShopCategory from '../Pages/ShopCategory';
import banner_men from './Assets/banner_men.jpg'; // Ya png - confirm extension

const Mens = () => {
  return (
    <ShopCategory category="Mens" banner={banner_men} />
  );
};

export default Mens;
